INSERT INTO `tbl_school_main_table` VALUES (1,'Vidyaniketan School','Ms.Lalitha Desikan','# 30, Kempapura, Hebbal, Bangalore - 560 024','Bangalore','India','560 024','13.0475813','77.59676820000004','http://www.vidyaniketanhebbal.org/','1','2','','5',2,'2','1','yes','080-23331531','Vidya Niketan School features 45 spacious, well- ventilated classrooms designed to make learning a pleasure. All classrooms are equipped with an Interactive White Board and Activinspire which plays a dynamic role in classroom learning and caters to the Mul','Vidya Niketan School follows the ICSE Syllabus till Std X and the ISCsyllabus for Std XI and XII.\n\nThe school is divided into 3 Sections \nPrimary school - Std I to IV Middle School - Std V to VII High School - Std VIII to X The ISC section has two streams - Science and Commerce',0,'1',' vidyaniketan@gmail.com','','2'),(2,'Sindhi High School','MAITHREYI SATYADEV','# 33/2A & B Hebbal Kempapura, Bengaluru, Karnataka 560024','Bangalore','India',' 560024','13.050091','77.59863799999994','http://sindhihighschool.edu.in/','1','2','','5',2,'1','1','yes','080-23621393/4','Sindhi High School at Hebbal was inaugurated on June 9, 2003 by the Deputy Prime Minister, Sri L.K.Advani in the presence of the Chief Minister Sri S.M.Krishna and other dignitaries.This initiative of Sindhi Seva Samiti was an extension of their vision of ','REGISTRATION\n\nRegistration forms may be collected from the School office and submit the duly filled to the School office before the end of registration period.\nIncomplete or illegible registration forms will not be processed\nDate for Interaction / written test will be given at the time of registration\nRegistration fee will not be refunded\nRegistration does not confirm admission. It is subject to qualifying in admission test / interaction and also availability of seats.\nhttp://sindhihighschool.edu.in/hebbal/admissions/\n',0,'1','assistacademicsshshebbal@gmail.com','','2');
